import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import FeedPage from "./pages/feed/";
function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" component={<FeedPage />} />
      </Switch>
    </Router>
  );
}

export default App;
